from suds.client import Client
from base64 import b64decode
import imghdr
import os
import unicodedata


def assign(ref, key, value):
    if value:
        ref.__setitem__(key, value)


client = Client('https://www.mijnbabs.nl/iBabsWCFService/Public.svc?singleWsdl')
client.set_options(port='BasicHttpsBinding_IPublic')

sitename = 'Utrecht'

users = dict()
for user in client.service.GetUsers(sitename).Users[0]:
    users[user['UniqueId']] = {
        'id': user['UniqueId'],
        'email': user['Emailaddress'],
        'full_name': user['Name'],
    }

for user_id in users:
    user = client.service.GetUser(sitename, user_id).User

    assign(users[user_id], 'can_vote', user['CanVote'])
    assign(users[user_id], 'role', user['PublicProfile']['FunctionName'])
    assign(users[user_id], 'first_name', user['PublicProfile']['Initials'])
    assign(users[user_id], 'insertion', user['PublicProfile']['Insertion'])
    assign(users[user_id], 'last_name', user['PublicProfile']['LastName'])
    assign(users[user_id], 'phone', user['PublicProfile']['Phone'])
    assign(users[user_id], 'party', user['PublicProfile']['PoliticalPartyName'])
    assign(users[user_id], 'subjects', user['PublicProfile']['Metadata']['iBabsKeyValue'][0]['Value'])

    pic_bytes = b64decode(user['PublicProfile']['Picture'])
    ext = imghdr.what(None, pic_bytes)
    slug = unicodedata.normalize('NFKD', user['Name'].lower()).encode('ascii', 'ignore').decode('ascii').strip().replace(" ", "-")

    base_path = 'static/pictures/{}'.format(sitename.lower())
    if not os.path.exists(os.path.abspath('../' + base_path)):
        os.makedirs('../' + base_path)

    path = '{}/{}.{}'.format(base_path, slug, ext)
    f = open(os.path.abspath('../' + path), 'wb')
    f.write(pic_bytes)
    f.close()

    assign(users[user_id], 'picture', path)

